####################################################################
# linux64-amd64-gcc42.cfg
# FSF's gcc 4.2 config file for
# AMD64 64-bit (64 bit binaries on 64 bit host)
# Config file for CPU2006	int and fp Base only
#####################################################################

ignore_errors = yes
tune          = base
ext           = amd64-m64-gcc42-nn
output_format = asc, pdf, Screen
reportable    = 1
teeout        = yes
teerunout     = yes
hw_avail = Dec-9999
license_num = 9999
test_sponsor = Turbo Computers
prepared_by = 
tester      =
test_date = Dec-9999

default=default=default=default:
#####################################################################
#
# Compiler selection
#
#####################################################################
#CC           = /usr/local/sles9/gcc42-0325/bin/gcc
CC           = /usr/bin/gcc
#CXX          = /usr/local/sles9/gcc42-0325/bin/g++
CXX          = /usr/bin/g++
#FC           = /usr/local/sles9/gcc42-0325/bin/gfortran
FC           = /usr/bin/gfortran

## HW config
hw_model     = Tyan Thunder KKQS Pro (S4882)
hw_cpu_name  = AMD Opteron 256
hw_cpu_char  =
hw_cpu_mhz   = 3000
hw_fpu       = Integrated
hw_nchips	= 1
hw_ncores	= 1
hw_ncoresperchip= 1
hw_nthreadspercore = 1
hw_ncpuorder = 1 chip
hw_pcache    = 64 KB I + 64 KB D on chip per chip
hw_scache    = 1 MB I+D on chip per chip
hw_tcache    = None
hw_ocache    = None
hw_memory	= 2 GB (2 x 1GB DDR333 CL2.5)
hw_disk		= SATA
hw_vendor	= Tyan

## SW config
sw_os        = SUSE SLES9 (for AMD64)
sw_file      = ext3
sw_state     = runlevel 3
sw_compiler  = gcc , g++ & gfortran 4.2.0325 (for AMD64)
sw_avail = Dec-9999
sw_other = None
sw_auto_parallel = No
sw_base_ptrsize = 64-bit
sw_peak_ptrsize = Not Applicable


#####################################################################
# Optimization
#####################################################################
## Base is low opt
default=base=default=default:
COPTIMIZE     = -O2
CXXOPTIMIZE  = -O2 
FOPTIMIZE    = -O2

notes0100= C base flags: $[COPTIMIZE]
notes0110= C++ base flags: $[CXXOPTIMIZE]
notes0120= Fortran base flags: $[FOPTIMIZE]

#######################################################################
# Floating point Baseline Optimization

fp=base:
sw_base_ptrsize    = 64-bit

OPTIMIZE     = -O3
COPTIMIZE    = -O3 
CXXOPTIMIZE  = -O3 
FOPTIMIZE    = -O2 

#######################################################################

#######################################################################
# Floating Point Peak

fp=peak:
sw_peak_ptrsize    = 64-bit
OPTIMIZE     = -O3 -OPT:Ofast 
PASS1_CFLAGS   = -fb_create fbdata
PASS1_CXXFLAGS = -fb_create fbdata
PASS1_FFLAGS   = -fb_create fbdata
PASS1_LDFLAGS  = -fb_create fbdata
PASS2_CFLAGS   = -fb_opt fbdata
PASS2_CXXFLAGS = -fb_opt fbdata
PASS2_FFLAGS   = -fb_opt fbdata
PASS2_LDFLAGS  = -fb_opt fbdata

410.bwaves,416.gamess,434.zeusmp,436.cactusADM,437.leslie3d,454.calculix,459.GemsFDTD,465.tonto,481.wrf=peak:
FOPTIMIZE    = -ipa

433.milc,470.lbm=peak:
COPTIMIZE    = -ipa

447.dealII,453.povray=peak:
CXXOPTIMIZE  = -ipa

#####################################################################
# 32/64 bit Portability Flags - all
#####################################################################

default=base=default=default:
notes25= PORTABILITY=-DSPEC_CPU_LP64 is applied to all benchmarks in base.
PORTABILITY = -DSPEC_CPU_LP64


#####################################################################
# Portability Flags - INT
#####################################################################

400.perlbench=default=default=default:
notes35    = 400.perlbench: -DSPEC_CPU_LINUX_X64
CPORTABILITY= -DSPEC_CPU_LINUX_X64

462.libquantum=default=default=default:
notes60= 462.libquantum: -DSPEC_CPU_LINUX
CPORTABILITY= -DSPEC_CPU_LINUX

483.xalancbmk=default=default=default:
CXXPORTABILITY= -DSPEC_CPU_LINUX


#####################################################################
# Portability Flags - FP
#####################################################################
fp=default=default=default:
PORTABILITY = -DSPEC_CPU_LP64

416.gamess=default=default=default:
FC=/usr/bin/gfortran-4.8
#FOPTIMIZE    = -O1
FOPTIMIZE    = -fno-aggressive-loop-optimizations

436.cactusADM=default=default=default:
FPORTABILITY = -fno-second-underscore

447.dealII=default=default=default:
CXXPORTABILITY = -DSPEC_CPU_TABLE_WORKAROUND
#447.dealII=base=amd64-m64-gcc42-nn=default:
# Last updated Wed Nov 14 18:47:27 2018
explicit_dimensions = 1
CXX=/usr/bin/g++-4.8

450.soplex=default=default=default:
CXX=/usr/bin/g++-4.8

481.wrf=default=default=default:
